import {BrowserRouter ,Routes,Route} from 'react-router-dom';

//pages and componets
import Home from './pages/Home'
import Navbar from './componets/Navbar';
import Footer from './componets/Footer'


function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Navbar/>
       <div className='pages'>
        <Routes>
          <Route
          path="/"
          element={<Home/>}
          />
        </Routes>
       </div>
       <Footer/>
      </BrowserRouter>
    </div>
  );
}

export default App;
